(window.webpackJsonp=window.webpackJsonp||[]).push([[9],{334:function(n,e,t){"use strict";t.r(e);var i=t(3),s=t.n(i),o=t(4),l=t.n(o),c=t(2),a=t.n(c),r=t(5),g=t.n(r),h=function(n){function e(){var n,i,o,c;l()(this,e);for(var r=arguments.length,g=Array(r),h=0;h<r;h++)g[h]=arguments[h];return i=o=a()(this,(n=e.__proto__||s()(e)).call.apply(n,[this].concat(g))),o.document=function(){return{document:t(413),className:"actionsheet-page"}},c=i,a()(o,c)}return g()(e,n),e}(t(402).a);e.default=h},413:function(n,e){n.exports="## 动作面板 ActionSheet\n\n### 基本用法\n\n```jsx\nimport { ActionSheet, Cell, Button } from 'zarm';\n\nconst BUTTONS = [\n  {\n    text: '操作一',\n    onClick: () => console.log('点击操作一'),\n  },\n  {\n    text: '操作二',\n    onClick: () => console.log('点击操作二'),\n  },\n  {\n    theme: 'error',\n    text: '操作三',\n    onClick: () => console.log('点击操作三'),\n  },\n];\n\nclass Demo extends React.Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      visible1: false,\n      visible2: false,\n      visible3: false,\n    };\n  }\n\n  toggle(key) {\n    this.setState({\n      [`${key}`]: !this.state[key],\n    });\n  }\n\n  render() {\n    return (\n      <div>\n        <Cell\n          description={\n            <Button size=\"xs\" onClick={() => this.toggle('visible1')}>开启</Button>\n          }\n        >\n          普通\n        </Cell>\n        <Cell\n          description={\n            <Button size=\"xs\" onClick={() => this.toggle('visible2')}>开启</Button>\n          }\n        >\n          带取消操作\n        </Cell>\n        <Cell\n          description={\n            <Button size=\"xs\" onClick={() => this.toggle('visible3')}>开启</Button>\n          }\n        >\n          圆角、留边\n        </Cell>\n\n        <ActionSheet\n          visible={this.state.visible1}\n          actions={BUTTONS}\n          onMaskClick={() => this.toggle('visible1')}\n        />\n        <ActionSheet\n          visible={this.state.visible2}\n          actions={BUTTONS}\n          onMaskClick={() => this.toggle('visible2')}\n          onCancel={() => this.toggle('visible2')}\n        />\n        <ActionSheet\n          spacing\n          shape=\"radius\"\n          visible={this.state.visible3}\n          actions={BUTTONS}\n          onMaskClick={() => this.toggle('visible3')}\n          onCancel={() => this.toggle('visible3')}\n        />\n      </div>\n    )\n  }\n}\n\nReactDOM.render(<Demo />, mountNode);\n```\n\n\n### API\n\n| 属性 | 类型 | 默认值 | 可选值／参数 | 说明 |\n| :--- | :--- | :--- | :--- | :--- |\n| prefixCls | string | za-action-sheet | | 类名前缀 |\n| className | string | | | 追加类名 |\n| shape | string | | 'radius' | 形状 |\n| visible | boolean | false | | 是否显示 |\n| spacing | boolean | false | | 是否和外部有间距 |\n| actions | Action[] | [ ] | Action = { text: string, <br /> theme?: 'default' &#124; 'primary' &#124; 'info' &#124; 'success' &#124; 'warning' &#124; 'error', <br /> className?: string, <br /> onClick?: () => void} | 动作列表 |\n| onMaskClick | <code>() => void</code> | noop | | 点击遮罩层时触发的回调函数 |\n| onCancel | <code>() => void</code> | noop | | 显示取消菜单，点击时触发的回调函数 |\n| cancelText | string | '取消' |  | 取消菜单的文案 |\n"}}]);